<p>KPA 可以选择更改均衡器的位置，在大多数放大器中，可以将其放置在增益级的前面或后面，当均衡器位于增益器的后面时，所对均衡器的任何改动，只会对声音的频段产生影响，而不会对失真度产生影响。</p>
