<p><code>Grid</code> 布局和 <code>flex</code> 布局是有实质性的区别的，<code>flex</code> 是一维布局，只能处理一个维度上的布局，一行或者是一列。但是 <code>Grid</code> 布局是二维布局 ，将容器划分成了“行”和“列”，产生了一个个的网格，可以将网格元素放在行和列相关的位置上，从而达到了布局的目的。</p>
