<p>不要将 JavaScript 与 <a href="https://en.wikipedia.org/wiki/Java_(programming_language)" target="_blank" rel="noreferrer">Java 编程语言</a>混淆。虽然“Java”和“JavaScript”都是 Oracle 公司在美国和其他国家注册（或未注册）的商标，但是这两门语言在语法、语义与用途方面有相当大的不同。</p>
